import React from 'react';
import './AccommodationForm.less';
import {
  Form, Radio, Button, Space, Input,
} from 'antd';
import { MinusCircleOutlined, PlusOutlined } from '@ant-design/icons';
import { ReactComponent as RoomIcon } from '../../../icons/room.svg';

const AccommodationForm = (): JSX.Element => {
  const onFinish = (values: any) => {
    console.log(values);
  };
  return (
    <div className="form">
      <div className="form-title">
        Мое объявление
      </div>
      <Form
        initialValues={{}}
        onFinish={onFinish}
      >
        <Form.Item label="Что сдаете?" name="roomType">
          <div className="form-room">
            <Radio.Group>
              <Radio.Button value="room">
                <div className="room-icon">
                  <RoomIcon />
                </div>
                <div className="room-title">
                  Комнату
                </div>
              </Radio.Button>
              <Radio.Button value="flat">
                <div className="room-icon flat">
                  <RoomIcon />
                </div>
                <div className="room-title">
                  Квартиру
                </div>
              </Radio.Button>
            </Radio.Group>
          </div>
        </Form.Item>
        <Form.List name="users">
          {(fields, { add, remove }) => (
            <>
              {fields.map(({
                key, name, fieldKey, ...restField
              }) => (
                <Space key={key} style={{ display: 'flex', marginBottom: 8 }} align="baseline">
                  <Form.Item
                    name={[name, 'first']}
                    fieldKey={[fieldKey, 'first']}
                    rules={[{ required: true, message: 'Missing first name' }]}
                  >
                    <Input placeholder="First Name" />
                  </Form.Item>
                  <Form.Item
                    name={[name, 'last']}
                    fieldKey={[fieldKey, 'last']}
                    rules={[{ required: true, message: 'Missing last name' }]}
                  >
                    <Input placeholder="Last Name" />
                  </Form.Item>
                  <MinusCircleOutlined onClick={() => remove(name)} />
                </Space>
              ))}
              <Form.Item>
                <Button type="dashed" onClick={() => add()} block icon={<PlusOutlined />}>
                  Add field
                </Button>
              </Form.Item>
            </>
          )}
        </Form.List>
        <Form.Item>
          <div className="button-wrapper">
            <Button htmlType="submit">
              Разместить объявление
            </Button>
          </div>
        </Form.Item>
      </Form>
    </div>
  );
};
export default AccommodationForm;
